import {useState} from 'react';
import { useParams } from 'react-router-dom';

function AddReview  ({ userData }) {
    let restaurantName;
    const {profileID} = useParams();

    const [reviewData, setReviewData] = useState({
        restaurant_name: "",
        ratings: []
    });

    function handleReviewInputChange(event){
        const {name, value} = event.target;

        name === 'restaurant_name' ? (restaurantName = value) : undefined;

        const newDishRating = {
            ...reviewData.ratings,
            [name] : value
        }

        setReviewData({
            ...reviewData,
            ratings: newDishRating
            })

        if( name === "dish_name" || name === 'cuisine') {
            const newDishRating = {
                ...reviewData.ratings,
                [name] : value
            }
            setReviewData({
                ...reviewData,
                ratings: newDishRating
                })
        } else if (
            name === "dish_size" ||
            name === "score"
        ) {
            const newNumberRating = {
                ...reviewData.ratings,
                [name] : Number(value)
            }
            setReviewData({
                ...reviewData,
                ratings: newNumberRating
            })
        } else {
            setReviewData({
                ...reviewData,
                [name] : value
            })
        }
    }
 // restaurantExists ? { post to ratings } : { post to reviews w/ restaurant name}

   function handleReviewSubmit(event){
        event.preventDefault()

        userData.forEach((user) => {
            if (user.id === profileID) {
                user.reviews.forEach((restaurant)=> {
                    if (restaurant.restaurant_name === restaurantName) {
                        fetch (`http://localhost:3000/profiles/${user.id}`, {
                            method: "PATCH",
                            headers: {
                                "Content-Type":  "application/json",
                                "Accept": "application/json"
                            },
                            body: JSON.stringify(
                                {
                                    ...user,
                                    reviews: [
                                        {
                                            ...user.reviews,
                                            ratings: [
                                                ...restaurant.ratings,
                                                reviewData.ratings
                                        ]}
                                    ]
                                }
                            )
                        })
                    }
                })
            } else if (user.id === profileID) {
                fetch (`http://localhost:3000/profiles/${user.id}`, {
                    method: "PATCH",
                    headers: {
                        "Content-Type": "application/json",
                        "Accept": "application/json"
                    },
                    body: JSON.stringify({
                        reviews: [
                            ...user.reviews,
                            {
                                restaurant_name: reviewData.restaurant_name,
                                ratings: [reviewData.ratings]
                            },
                            ]
                        })
                })
                .then(response => {
                    if (response.ok) {
                        return response.json().then(returnedData => {
                            console.log(returnedData)
                        })
                    }
                })
            }
        })
    }

        // userData.forEach((user)=> {
            // if (Number(user.id) === profileID) {
            //     fetch (`http://localhost:3000/profiles/${user.id}`, {
            //         method: "PATCH",
